import * as React from "react";
import { useState } from "react";
import "./App.css";

import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Modal from "@mui/material/Modal";

import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import { withRouter } from "react-router";

function Login(props) {
  const [user, setUser] = useState({
    email: "",
    mob_no: "",
    password: "",
  });

  const handleClick = () => {
    let data = {
      email: user.email,
      mob_no: user.mob_no,
      password: user.password,
    };

    if (user.email !== "" && user.mob_no !== "" && user.password !== "") {
      setTimeout(() => {
        props.history.push("/userDetails");
      }, 2000);
    } else {
      alert("Fill all details properly");
    }
  };

  return (
    <>
      <div className="background">
        <form id="form3" action="">
          <h1>Enter your details for Login</h1>
          <br />
          <TextField
            id="outlined-required"
            required
            label="Email"
            className="input"
            placeholder="Enter your mail here"
            value={user.email}
            onChange={(event) =>
              setUser((previousState) => {
                return { ...previousState, email: event.target.value };
              })
            }
          />
          <br /> <br />
          <TextField
            id="outlined-number"
            required
            autoComplete="username"
            className="input"
            label="Mobile Number"
            type="number"
            value={user.mob_no}
            onChange={(event) =>
              setUser((previousState) => {
                return { ...previousState, mob_no: event.target.value };
              })
            }
          />{" "}
          <br /> <br />
          <TextField
            id="outlined-password-input"
            label="Password"
            type="password"
            value={user.password}
            required
            className="input"
            placeholder="Enter your Password here"
            onChange={(event) =>
              setUser((previousState) => {
                return { ...previousState, password: event.target.value };
              })
            }
            autoComplete="current-password"
          />{" "}
          <br /> <br />
          <br />
          <Button onClick={handleClick} variant="outlined" className="btn1">
            Login
          </Button>
        </form>
      </div>
    </>
  );
}

export default withRouter(Login);
